VALUES ('3291810273877', '4 Paniers feuilletés volaille champignons - surgelés 400 g', 'Pâte feuilletée dorée 50,7% : farine de blé, margarine (huiles et graisses végétales non hydrogénées de palme, de colza, de coprah et de tournesol, eau, sel, mono et diglycérides d\'acides gras d\'origine végétale, arôme naturel), eau, oeufs entiers, sel. - Garniture 49,3% : Eau, dés de dinde traités en salaison 20,1% (viande de dinde 93%, sirop de glucose de blé, sel, carraghénanes, chlorure de potassium, polyphosphates), champignons de Paris émincés et en cubes 19,8% (dont: sulfite acide de sodium), préparation en poudre pour béchamel (lactose et protéines de lait, amidon transformé de pomme de terre, matière grasse végétale de coprah non hydrogénée, sel, alginate de sodium, arômes naturels de poivre et de muscade, caroténoïdes mélangés), oignons en cubes 7,5%, crème 7,5% (dont: carraghénanes), emmental râpé 4,9%, oeufs entiers, extrait de volaille rôtie, sel, caramel ordinaire.', 'https://static.openfoodfacts.org/images/products/329/181/027/3877/front_fr.7.400.jpg', '18.3', '', '22.5', '', '', '7.2', '1.3', '0.511811023622047', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3291810277318', 'Tarte Tropézienne', 'Garniture (47,5 %): eau, préparation pour crème mousseline (35,8 %) (sucre, huile et matières grasses végétales de palme non hydrogénées, amidon transformé de pomme de terre, _lactosérum_ en poudre, _crème_ de _lait_ en poudre, sirop de glucose de blé ou de maïs ou de pomme de terre, émulsifiant: esters acétiques des mono- et diglycérides d\'acides gras d\'origine végétale, gélifiant: carraghénanes (carraghénanes, dextrose de maïs), protéines de _lait_, stabilisant: triphosphates, arôme naturel, colorant: caroténoïdes), préparation aromatisante alcoolisée (alcool, arômes naturels, eau, cognac). (Pourcentage exprimé sur la garniture). Brioche (34,5 %): farine (farine de _blé_, _gluten de blé_), eau, _œufs_ entiers liquides pasteurisés, _beurre_ pasteurisé (6,9 %), sucre, _crème_ fraîche pasteurisée, levure, régulateur de panification (_gluten de blé_, farine de _blé_ malté, germes de _blé_, farine de _blé_, enzymes), sel. (Pourcentage exprimé sur la brioche).  Décor (18 %): sirop (42,1 %) (eau, sucre), sucre décor (42,1 %) (sucre, matière grasse végétale de palme non hydrogénée, amidon transformé de pomme de terre), nappage (15,8% ) (sirop de glucose-fructose de blé, eau, sucre, gélifiants: pectines-alginate de sodium, acidifiant: acide citrique, conservateur: sorbate de potassium). (Pourcentages exprimés sur le décor).', 'https://static.openfoodfacts.org/images/products/329/181/027/7318/front_fr.8.400.jpg', '6.2', '3.8', '49.8', '34.7', '', '3.4', '0.3', '0.118110236220472', '', '0');

