VALUES ('3291960072016', 'Huile d\'olive vierge extra Italie et Sicile, bio', 'HUILE D\'OLIVE VIERGE EXTRA BIOLOGIQUE EXTRAITE À FROID Italie Huile d\'olive de catégorie supérieure obtenue directement des olives et uniquement par des procédés mécaniques. Entre ciel et mer, c\'est dans ce haut lieu de l\'olipe que s\'épanouissent les pariétés d\'olives Nocellara del Belice. Les olipes cueillies à maturité sont triturées sur froid. Allrès décantation, l\'huile est filtrée apant d\'etre mise en bouteille. Une robe pert clair apec des reflets jaunes goût agréablement fruité, laissant une pointe d\'amertume en arrière bouche.', '', '100', '15', '0', '0', '0', '0', '0', '0', '', '0');

